// pages/DetailScreening.js

import React, { useEffect, useState } from 'react';
import axios from 'axios';
import Header from '../components/Header';
import Footer from '../components/Footer';
import { useParams, useNavigate } from 'react-router-dom';
import { allQuestions } from '../screens/question';
import { fieldKeys } from '../screens/fieldKeys';

const DetailScreening = () => {
  const { id } = useParams();
  const navigate = useNavigate();
  const [data, setData] = useState(null);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchDetail = async () => {
      try {
        const response = await axios.get(`http://localhost:5000/detail-screening/${id}`);
        setData(response.data);
      } catch (err) {
        console.error('Gagal mengambil detail screening:', err);
        setError('Data tidak ditemukan atau terjadi kesalahan.');
      }
    };

    fetchDetail();
  }, [id]);

  const handleBack = () => {
    navigate('/riwayat');
  };

  return (
    <div>
      <Header />

      <div className="container mt-4 mb-5">
        <h3 className="mb-4 text-center">Detail Hasil Screening</h3>

        {error ? (
          <div className="alert alert-danger text-center">{error}</div>
        ) : !data ? (
          <div className="text-center">Memuat data...</div>
        ) : (
          <>
            <div className="mb-4">
              <p><strong>Nama:</strong> {data.nama_pasien}</p>
              <p><strong>NIK:</strong> {data.nik}</p>
              <p><strong>Jenis Kelamin:</strong> {data.jenis_kelamin}</p>
              <p><strong>No HP:</strong> {data.no_hp}</p>
              <p><strong>Usia:</strong> {data.usia}</p>
              <p><strong>Alamat:</strong> {data.alamat}</p>
              <p><strong>Tanggal Screening:</strong> {new Date(data.tanggal_screening).toLocaleDateString('id-ID')}</p>
              <p><strong>Hasil:</strong> 
                <span className={`ms-2 badge ${data.hasil === 'Positif' ? 'bg-danger' : 'bg-success'}`}>
                  {data.hasil}
                </span>
              </p>
              <p><strong>Probabilitas:</strong> {(data.probabilitas * 100).toFixed(2)}%</p>
              {data.catatan && <p><strong>Catatan:</strong> {data.catatan}</p>}
            </div>

            <h5 className="mt-4 mb-3">Jawaban Screening:</h5>
            <ul className="list-group">
              {allQuestions.map((pertanyaan, index) => {
                const field = fieldKeys[index];
                const jawaban = data[field];

                return (
                  <li key={index} className="list-group-item d-flex justify-content-between align-items-center">
                    <span>{index + 1}. {pertanyaan}</span>
                    <span className={`badge ${jawaban === 1 ? 'bg-danger' : jawaban === 0 ? 'bg-success' : 'bg-secondary'}`}>
                      {jawaban === 1 ? 'Ya' : jawaban === 0 ? 'Tidak' : 'Tidak tersedia'}
                    </span>
                  </li>
                );
              })}
            </ul>

            <div className="mt-4 text-center">
              <button className="btn btn-secondary" onClick={handleBack}>Kembali ke Riwayat</button>
            </div>
          </>
        )}
      </div>

      <Footer />
    </div>
  );
};

export default DetailScreening;
